import React, { useState } from 'react';
import DataLoader from './components/Exercise13/DataLoader';
import TodoListReducer from './components/Exercise14/TodoListReducer';
import OptimizedList from './components/Exercise15/OptimizedList';
import ErrorBoundary from './components/Exercise16/ErrorBoundary';
import BuggyComponent from './components/Exercise16/BuggyComponent';
import Modal from './components/Exercise17/Modal';
import Counter from './components/Exercise18/Counter';
import LoginForm from './components/Exercise19/LoginForm';

function App() {
  const [currentExercise, setCurrentExercise] = useState('13');
  const [modalOpen, setModalOpen] = useState(false);

  const renderExercise = () => {
    switch (currentExercise) {
      case '13':
        return (
          <div>
            <h2>Exercise 13: Render Props for Data Fetching</h2>
            <DataLoader
              render={({ data, loading, error }) => {
                if (loading) return <div>Loading...</div>;
                if (error) return <div>Error: {error}</div>;
                return (
                  <div>
                    <h3>Post Data:</h3>
                    <div><strong>Title:</strong> {data.title}</div>
                    <div><strong>Body:</strong> {data.body}</div>
                  </div>
                );
              }}
            />
          </div>
        );
      case '14':
        return <TodoListReducer />;
      case '15':
        return <OptimizedList />;
      case '16':
        return (
          <div>
            <h2>Exercise 16: Error Boundary</h2>
            <ErrorBoundary>
              <BuggyComponent />
            </ErrorBoundary>
          </div>
        );
      case '17':
        return (
          <div>
            <h2>Exercise 17: Modal with Portals</h2>
            <button onClick={() => setModalOpen(true)}>Open Modal</button>
            <Modal isOpen={modalOpen} onClose={() => setModalOpen(false)}>
              <h3>This is a modal!</h3>
              <p>Click outside or the × to close.</p>
            </Modal>
          </div>
        );
      case '18':
        return <Counter />;
      case '19':
        return <LoginForm />;
      default:
        return <div>Select an exercise</div>;
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>React Lab - Advanced Exercises</h1>
      <div style={{ marginBottom: '20px' }}>
        <button onClick={() => setCurrentExercise('13')}>Exercise 13</button>
        <button onClick={() => setCurrentExercise('14')}>Exercise 14</button>
        <button onClick={() => setCurrentExercise('15')}>Exercise 15</button>
        <button onClick={() => setCurrentExercise('16')}>Exercise 16</button>
        <button onClick={() => setCurrentExercise('17')}>Exercise 17</button>
        <button onClick={() => setCurrentExercise('18')}>Exercise 18</button>
        <button onClick={() => setCurrentExercise('19')}>Exercise 19</button>
      </div>
      {renderExercise()}
    </div>
  );
}

export default App;
